tables.table_schema:
CREATE TABLE interactive_dashboards (
    id INT PRIMARY KEY,
    dashboard_name VARCHAR(255),
    dashboard_description TEXT,
    created_at TIMESTAMP
);

CREATE TABLE visualization_tools (
    tool_id INT PRIMARY KEY,
    tool_name VARCHAR(255),
    tool_category VARCHAR(50),
    tool_description TEXT
);

CREATE TABLE Interactive_Dashboards (
    dashboard_id SERIAL PRIMARY KEY,
    dashboard_name TEXT NOT NULL,
    data_source_id INT NOT NULL
);

CREATE TABLE Data_Sources (
    data_source_id SERIAL PRIMARY KEY,
    source_name TEXT NOT NULL,
    data_type TEXT,
    connection_info TEXT
);

CREATE TABLE Dashboard_Elements (
    element_id SERIAL PRIMARY KEY,
    dashboard_id INT NOT NULL,
    element_name TEXT NOT NULL,
    element_type TEXT
);

CREATE TABLE Dataset (
    id INT PRIMARY KEY,
    title VARCHAR(255),
    description TEXT,
    data JSON
);

CREATE TABLE User (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(255)
);

CREATE TABLE Dashboard (
    dashboard_id INT PRIMARY KEY,
    name VARCHAR(100),
    owner_id INT,
    FOREIGN KEY (owner_id) REFERENCES User(user_id)
);
